import React, {Component} from "react"
import "./Uslugi.css"
import {translate} from "react-switch-lang";
import {Container, Card, CardDeck} from "react-bootstrap";




class Uslugi extends Component {
    state = {
        id:"0"
    }
    render() {
        const {t} = this.props;
        return (
            <div>
            <Container className={"uslugi"} id={this.props.id}>
                <div className={"pt-3"}>
                    <h1 className="heading-title text-center text-dark">{t('header.section3.title')}</h1>
                </div>
                    <CardDeck>
                        <Card border="primary" style={{ width: '18rem' }}>
                            <Card.Img></Card.Img>
                            <Card.Body>
                            <Card.Title><h5 className="elementskit-info-box-title">
                                OBSŁUGA PRAWNA PRZEDSIĘBIORCÓW </h5>
                            </Card.Title>
                            <Card.Text><p>Z nami łatwo poprowadzisz swój biznes. </p></Card.Text>
                            </Card.Body>
                        </Card>
                        <Card>

                        </Card>
                        <Card>

                        </Card>
                        <Card>

                        </Card>
                    </CardDeck>
            </Container>
            </div>
        )
    }
}
export default translate(Uslugi)
